Rosa Love Your Imagination (Diamond Bois / Joybear Pictures / 2013)

Rosa, a quirky and eccentric French girl in London, decides to give up men in order to write a book.
She soon finds her vow of abstinence much harder than expected and turns to her mischievous imagination to help her through.

Christian XXX, Danny D, Cathy Heaven, Marc Rose, Angell Summers, Kai Taylor, Rebecca More, Megan Coxxx, Samantha Bentley

Feature, Big Tits

